type TokenPostProps = {
    username: string,
    password: string
}

// Solicita o token do usuario após autenticação
export function TOKEN_POST(body) {
    return {
      url: process.env.REACT_APP_ENDPOINT + "/jwt-auth/v1/token",
      options: {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(body),
      },
    };
  }
